class SplashScreen extends StatefulWidget {
  const SplashScreen({super.key});

  @override
  _SplashScreenState createState() => _SplashScreenState();
}

class _SplashScreenState extends State<SplashScreen> {
  double _opacity = 0.0;

  @override
  void initState() {
    super.initState();
    _fadeIn();
    _navigateToSignIn();
  }

  void _fadeIn() {
    Future.delayed(
      const Duration(milliseconds: 1000),
          () {
        setState(
              () {
            _opacity = 1.0;
          },
        );
      },
    );
  }

  void _navigateToSignIn() {
    Future.delayed(
      const Duration(seconds: 3),
          () {
        Navigator.of(context).pushReplacement(
          MaterialPageRoute(
            //builder: (context) => const SignInScreen(),
            builder: (context) =>  Home(),
          ),
        );
      },
    );
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      body: Stack(
        children: [
          Container(
            decoration: const BoxDecoration(
                gradient: LinearGradient(
                    colors: [
                      Color.fromRGBO(255, 208, 208, 0.86), //255,208,208
                      Color.fromRGBO(225, 172, 172, .53), //225,172,172
                      Color.fromRGBO(202, 135, 135, .40), //202,135,135
                      Color.fromRGBO(168, 118, 118, .20), //168,118,118
                      Color.fromRGBO(245, 218, 210, .20) //245,218,210
                    ],
                    begin: Alignment.bottomCenter,
                    end: Alignment.topCenter,
                 ),
            ),

          ),
          Center(
            child: Column(
              mainAxisAlignment: MainAxisAlignment.center,
              children: [
                AnimatedOpacity(
                  opacity: _opacity,
                  duration: const Duration(milliseconds: 500),
                  child: SvgPicture.string(
                    svgString,
                    width: 200,
                    height: 200,
                  ),
                ),
                const SizedBox(height: 10),
                AnimatedOpacity(
                  opacity: _opacity,
                  duration: const Duration(milliseconds: 500),
                  child: Text(
                    'Pet \nHub',
                    style: TextStyle(
                      fontSize: 64,
                      fontWeight: FontWeight.bold,
                      color: Color.fromARGB(255, 86, 59, 26),
                      height: 1,
                    ),
                    textAlign: TextAlign.center,
                  ),
                ),
                SizedBox(height:MediaQuery.of(context).size.height/7 ,),
                const SizedBox(
                  height: 40.0,
                  width: 40.0,
                  child: CircularProgressIndicator(
                    color: Color.fromARGB(255, 86, 59, 26),
                  ),
                ),
              ],
            ),
          ),
        ],
      ),
    );
  }
}

